import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the price filter elements to be available
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.waitForSelector('#maxPrice', { timeout: 5000 });
    await page.waitForSelector('.apply-filter', { timeout: 5000 });

    // Fill in the minimum price
    await page.fill('#minPrice', '50');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_min_price_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_min_price_filled.png'));

    // Fill in the maximum price
    await page.fill('#maxPrice', '150');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_max_price_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_max_price_filled.png'));

    // Click the apply filter button
    await page.click('.apply-filter');

    // Wait for a moment for any potential UI updates, although the script doesn't show any visual change
    await page.waitForTimeout(500); // Small delay to ensure action completes

    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_filter_applied.png'));

    // Extract the values from the input fields to verify
    const minPriceValue = await page.inputValue('#minPrice');
    const maxPriceValue = await page.inputValue('#maxPrice');

    return {
      success: true,
      action: "Applied price range filter from 50 to 150.",
      extractedData: {
        minPrice: minPriceValue,
        maxPrice: maxPriceValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
